import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';

const ScoredPicksPage = () => {
  const { week } = useParams();
  const [scores, setScores] = useState([]);

  useEffect(() => {
    fetch(`/api/scores/${week}`)
      .then(res => res.json())
      .then(data => setScores(data))
      .catch(err => console.error('Error fetching scores:', err));
  }, [week]);

  return (
    <div>
      <h1>Week {week} Results</h1>
      <table style={{ marginTop: '20px', fontSize: '18px' }}>
        <thead>
          <tr>
            <th style={{ paddingRight: '20px' }}>Player</th>
            <th>Score</th>
          </tr>
        </thead>
        <tbody>
          {scores.map((player, index) => (
            <tr key={index}>
              <td>{player.name}</td>
              <td>
                {player.score}
                {player.score === 10 && (
                  <span style={{ marginLeft: '10px', color: 'gold' }}>‚≠ê Great Job!</span>
                )}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ScoredPicksPage;
